import './App.css';
import React  from 'react';

import {
  Screen,
  Modal
} from "./standards/styledDivs.js";

function App() {
  return (
    <Screen>
      <Modal>
        <div>Welocme</div>
        <div>Login / SignUp</div>
      </Modal>
    </Screen>
  );
}

export default App;
